export default function Intro() {
  return (
    <section class="intro-propz"> 
          <div class="wrap">                       
              <p>As lojas <span>Propz</span> possuem um espaço beleza onde você encontra tudo para montar looks únicos.</p>
              <p>Venha conhecer!</p>
          </div> 
    </section>
  );
}
